using System;using System.Linq;using System.Text;namespace EntidadesLayout.Ent {	[Serializable]	public class AplicationForm	{		private Guid aplicationFormKey;		private string timeJustification;		private int? exchangeRate;		private bool? isDesigned;		private DateTime? creationDate;		private Guid? mD5QMSFk;		private Guid? schemeCertificationFk;		private Guid? clienteFk;		private Guid? schemeMoneyFk;		public AplicationForm(){}		public Guid AplicationFormKey		{			get { return aplicationFormKey; }			set { aplicationFormKey = value; }		}		public string TimeJustification		{			get { return timeJustification; }			set { timeJustification = value; }		}		public int? ExchangeRate		{			get { return exchangeRate; }			set { exchangeRate = value; }		}		public bool? IsDesigned		{			get { return isDesigned; }			set { isDesigned = value; }		}		public DateTime? CreationDate		{			get { return creationDate; }			set { creationDate = value; }		}		public Guid? MD5QMSFk		{			get { return mD5QMSFk; }			set { mD5QMSFk = value; }		}		public Guid? SchemeCertificationFk		{			get { return schemeCertificationFk; }			set { schemeCertificationFk = value; }		}		public Guid? ClienteFk		{			get { return clienteFk; }			set { clienteFk = value; }		}		public Guid? SchemeMoneyFk		{			get { return schemeMoneyFk; }			set { schemeMoneyFk = value; }		}	}}

